export default Buses;

const Style = styled.div`
  .bus {
    width: 30vw;
  }

  @media screen and (max-width: 1198px) {
    .busDiv {
      justify-content: center;
      display: flex;
      flex-direction: column;
    }
    .bus {
      width: 80vw;
      svg {
        width: 100vh;
      }
    }

    #Disney {
      display: flex;
      width: 100vw;
      position: relative;
      justify-content: center;
      min-height: 50vh;

      svg {
        height: auto;
        position: relative;
        right: 4%;

        width: 80vw;
      }
    }
  }

  #carBody {
    animation: shakeverticalCar 4s infinite;
  }
  #upMan,
  #driver,
  #downA,
  #downB,
  #downC {
    animation: shakeverticalPassenger 4s infinite;
  }

  #frontwheel,
  #backwheel,
  #frontWheel {
    animation: wheel 0.3s infinite linear;
    transform-origin: center;
    transform-box: fill-box;
  }
`;
